// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "./ProjectNFT.sol";
import "./CarbonToken.sol";

contract ProjectManager is AccessControl, Pausable {
    bytes32 public constant PROJECT_OWNER_ROLE = keccak256("PROJECT_OWNER_ROLE");
    bytes32 public constant VALIDATOR_ROLE = keccak256("VALIDATOR_ROLE");

    ProjectNFT public projectNFT;
    CarbonToken public carbonToken;

    // Staking requirements
    uint256 public constant VALIDATOR_STAKE_AMOUNT = 50 ether;
    uint256 public constant PROJECT_OWNER_STAKE_AMOUNT = 10 ether;

    // Mapping to track staked amounts
    mapping(address => uint256) public stakedAmount;

    // Mapping to track validator assignments to projects
    mapping(uint256 => address) public projectValidator;

    // Mapping for project metadata
    struct ProjectDetails {
        address owner;
        uint256 expectedCredits;
        bool isRegistered;
        bool isValidated;
    }
    mapping(uint256 => ProjectDetails) public projects;

    // Events
    event ProjectRegistered(uint256 indexed projectId, address indexed owner, string metadataURI);
    event ProjectValidated(uint256 indexed projectId, address indexed validator);
    event ValidatorStaked(address indexed validator, uint256 amount);
    event ProjectOwnerStaked(address indexed projectOwner, uint256 amount);
    event StakeWithdrawn(address indexed staker, uint256 amount);

    constructor(address _projectNFT, address _carbonToken) {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        projectNFT = ProjectNFT(_projectNFT);
        carbonToken = CarbonToken(_carbonToken);
    }

    // Staking functions
    function stakeAsValidator() external payable whenNotPaused {
        require(msg.value == VALIDATOR_STAKE_AMOUNT, "Incorrect stake amount");
        require(!hasRole(VALIDATOR_ROLE, msg.sender), "Already a validator");

        stakedAmount[msg.sender] = msg.value;
        _setupRole(VALIDATOR_ROLE, msg.sender);

        emit ValidatorStaked(msg.sender, msg.value);
    }

    function stakeAsProjectOwner() external payable whenNotPaused {
        require(msg.value == PROJECT_OWNER_STAKE_AMOUNT, "Incorrect stake amount");
        require(!hasRole(PROJECT_OWNER_ROLE, msg.sender), "Already a project owner");

        stakedAmount[msg.sender] = msg.value;
        _setupRole(PROJECT_OWNER_ROLE, msg.sender);

        emit ProjectOwnerStaked(msg.sender, msg.value);
    }

    function withdrawStake() external whenNotPaused {
        require(stakedAmount[msg.sender] > 0, "No stake to withdraw");

        // Ensure no active projects for project owners
        if (hasRole(PROJECT_OWNER_ROLE, msg.sender)) {
            require(!hasActiveProjects(msg.sender), "Has active projects");
        }

        // Ensure no active validations for validators
        if (hasRole(VALIDATOR_ROLE, msg.sender)) {
            require(!hasActiveValidations(msg.sender), "Has active validations");
        }

        uint256 amount = stakedAmount[msg.sender];
        stakedAmount[msg.sender] = 0;

        if (hasRole(VALIDATOR_ROLE, msg.sender)) {
            revokeRole(VALIDATOR_ROLE, msg.sender);
        }
        if (hasRole(PROJECT_OWNER_ROLE, msg.sender)) {
            revokeRole(PROJECT_OWNER_ROLE, msg.sender);
        }

        payable(msg.sender).transfer(amount);
        emit StakeWithdrawn(msg.sender, amount);
    }

    // Project registration and validation
    function registerProject(string memory metadataURI, uint256 expectedCredits) 
        external 
        whenNotPaused 
        onlyRole(PROJECT_OWNER_ROLE) 
        returns (uint256) 
    {
        uint256 projectId = projectNFT.registerProject(msg.sender, metadataURI);

        projects[projectId] = ProjectDetails({
            owner: msg.sender,
            expectedCredits: expectedCredits,
            isRegistered: true,
            isValidated: false
        });

        emit ProjectRegistered(projectId, msg.sender, metadataURI);
        return projectId;
    }

    function validateProject(uint256 projectId) 
        external 
        whenNotPaused 
        onlyRole(VALIDATOR_ROLE) 
    {
        require(projects[projectId].isRegistered, "Project not registered");
        require(!projects[projectId].isValidated, "Project already validated");
        require(projectValidator[projectId] == address(0), "Validator already assigned");

        projectValidator[projectId] = msg.sender;
        projects[projectId].isValidated = true;

        // Verify the project in ProjectNFT contract
        projectNFT.verifyProjectStatus(projectId);

        // Mint carbon credits
        carbonToken.mintCarbonCredits(
            projectId,
            projects[projectId].owner,
            projects[projectId].expectedCredits
        );

        emit ProjectValidated(projectId, msg.sender);
    }

    // Helper functions
    function hasActiveProjects(address owner) public view returns (bool) {
        // Implementation would check for any non-completed projects
        return false; // Placeholder
    }

    function hasActiveValidations(address validator) public view returns (bool) {
        // Implementation would check for any ongoing validations
        return false; // Placeholder
    }

    // Admin functions
    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    // Required override
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

contracts/ProjectNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract ProjectNFT is ERC721, AccessControl, Pausable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    bytes32 public constant VALIDATOR_ROLE = keccak256("VALIDATOR_ROLE");

    enum Status { Unverified, UnderReview, Verified }

    struct Project {
        Status status;
        string metadataURI;
    }

    // Mapping from token ID to Project
    mapping(uint256 => Project) private _projects;

    // Events
    event ProjectRegistered(uint256 indexed projectId, address indexed owner, string metadataURI);
    event ProjectUpdated(uint256 indexed projectId, string newMetadataURI);
    event ProjectVerified(uint256 indexed projectId);
    event Staked(address indexed validator, uint256 amount);
    event Unstaked(address indexed validator, uint256 amount);
    event Slashed(address indexed validator, uint256 amount);

    constructor() ERC721("Carbon Project NFT", "CPNFT") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(VALIDATOR_ROLE, msg.sender);
    }

    function registerProject(address to, string memory metadataURI) 
        external 
        whenNotPaused 
        returns (uint256) 
    {
        _tokenIds.increment();
        uint256 newProjectId = _tokenIds.current();

        _safeMint(to, newProjectId);
        _projects[newProjectId] = Project({
            status: Status.Unverified,
            metadataURI: metadataURI
        });

        emit ProjectRegistered(newProjectId, to, metadataURI);
        return newProjectId;
    }

    function updateProjectMetadata(uint256 projectId, string memory newMetadataURI) 
        external 
        whenNotPaused 
    {
        require(_exists(projectId), "Project does not exist");
        require(ownerOf(projectId) == msg.sender || hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 
                "Not authorized to update metadata");

        _projects[projectId].metadataURI = newMetadataURI;
        emit ProjectUpdated(projectId, newMetadataURI);
    }

    function verifyProjectStatus(uint256 projectId) 
        external 
        whenNotPaused 
        onlyRole(VALIDATOR_ROLE) 
    {
        require(_exists(projectId), "Project does not exist");
        _projects[projectId].status = Status.Verified;
        emit ProjectVerified(projectId);
    }

    function getProjectStatus(uint256 projectId) external view returns (Status) {
        require(_exists(projectId), "Project does not exist");
        return _projects[projectId].status;
    }

    function getProjectMetadata(uint256 projectId) external view returns (string memory) {
        require(_exists(projectId), "Project does not exist");
        return _projects[projectId].metadataURI;
    }

    // Staking functionality (placeholder)
    function stake() external payable {
        require(msg.value > 0, "Must stake some ETH");
        emit Staked(msg.sender, msg.value);
    }

    function unstake(uint256 amount) external {
        require(amount > 0, "Must unstake some ETH");
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "Transfer failed");
        emit Unstaked(msg.sender, amount);
    }

    function slash(address validator) external onlyRole(DEFAULT_ADMIN_ROLE) {
        // Implementation would include actual slashing logic
        emit Slashed(validator, 0);
    }

    // Pausable functions
    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    // Required overrides
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override whenNotPaused {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

